<!DOCTYPE html>
<html>
<head>
<script>
function goBack() {
  window.history.go(-5)
}
</script>
</head>
<body>

<button onclick="goBack()">Go 5 pages back</button>

<p>Clicking on the "Go 5 pages back" button here will not result in any action, because there is no previous URL in the history list.</p>

</body>
</html>
